    root: {
      flexGrow: 1,
      width:'auto',
    },
  }));

export default function AboutPage(){

    const classes = useStyles();

    return(
        <Container maxWidth="sm">
        <Box my={4}>
          <Typography variant="h4" component="h1" gutterBottom>
            Gatsby v4-beta example
          </Typography>

        </Box>
      </Container>
    )
}
